import React from 'react';

const styles = {
    image: {
        width: '25%',
        minWidth: '250px',
        height: '25%',
        minHeight: '250px',
        borderRadius: '25%',
        borderColor: 'black',
        borderWidth: '5px',

    },
    ptag: {
        fontSize: '25px',
        fontFamily: 'fantasy',
        fontWeight: '940',
        lineHeight: '26px',
    },
    ptag2: {
        fontSize: '25px',
        fontFamily: 'fantasy',
        fontWeight: '940',
        lineHeight: '30px',
    },
    grey: {
        color: 'slategrey'
    }
}

const About = () => {

    return (

        <>
            <div className='portfoliocontainer'>
                <div className="aboutcontainer">
                    <div className="aboutleftside">
                        <img src='https://avatars0.githubusercontent.com/u/54956992?s=460&v=4' alt='picture' style={styles.image} />
                        <h1 style={styles.grey}>.</h1>
                    </div>
                    <div className="aboutrightside">
                        <center>
                            <p style={styles.ptag}>Hi, my name is Chase Lipscomb and I am a Front-End Developer...</p>
                            <p style={styles.ptag2}>I enjoy creating responsive designs and have the ability to communicate well with team members to minimize debugging and downtime. Some of my skills include mobile first design, concentrated Javascript, and client/server logic. </p>
                            <p style={styles.ptag}>Core Compentencies: HTML/CSS, JavaScript, jQuery, React, Redux, MySQL, MongoDB, Node, Express</p>
                        </center>
                    </div>

                </div>

            </div>
        </>
    )
}
export default About
